import React from 'react';
//import styled from 'styled-components';
import { NavLink, useHistory } from 'react-router-dom';
import './menu.css';

export const Menu = () => {
  const history = useHistory();

  const logout = () => {
    localStorage.removeItem("user");
    history.push("/");
    alert(
      "You have been Logged Out successfully."
    );
  }

  return (
    <nav role="navigation" >
      <div id="menuToggle">
        <input type="checkbox" />
        <span></span>
        <span></span>
        <span></span>
        <ul id="menu" >
          <li><NavLink exact to={'/home'}>Home</NavLink></li>
          <a><li><NavLink exact to={'/company-details'}>Test Links</NavLink></li></a>
          <a href="https://bitbucket.org/ppmap/ppmap-web" ><li>Repo</li></a>
          <a href="https://www.figma.com/file/0wSgj11sEa6CILhgSQuOuZ/PPMAP-(DEV-READY)" ><li>Designs</li></a>
          <a><li><NavLink exact to={'/onboarding/login-test'}>Login Test</NavLink></li></a>
          <a onClick={logout}><li>Log Out</li></a>
        </ul>

      </div>
    </nav>
  )
}
